{'full_text': '“Is there anything we could do for prevention?”

There is no vaccine and little beyond basic hygiene to minimise risk of infection - doctors will be trying to quickly diagnose and isolate cases, and trace people who patients have come into contact with

https://t.co/8UWUZn8dLk', 'display_text_range': [0, 277], 'entities': {'hashtags': [], 'urls': [{'url': 'https://t.co/8UWUZn8dLk', 'expanded_url': 'http://bbc.in/2Ghbo65', 'display_url': 'bbc.in/2Ghbo65', 'indices': [254, 277]}], 'user_mentions': [], 'symbols': []}}

{'full_text': 'Most of the "new" cases were already out there but have only just been detected as China steps up its surveillance

There is actually very little information on the "growth rate" of the outbreak

https://t.co/8UWUZn8dLk', 'display_text_range': [0, 219], 'entities': {'hashtags': [], 'urls': [{'url': 'https://t.co/8UWUZn8dLk', 'expanded_url': 'http://bbc.in/2Ghbo65', 'display_url': 'bbc.in/2Ghbo65', 'indices': [196, 219]}], 'user_mentions': [], 'symbols': []}}

{'full_text': '"How quickly does the virus spread, compared to previous outbreaks?”

It's very hard to know how fast it is actually spreading. It might appear as though cases have soared, from 40 to 440 in less than a week. But this is misleading...

https://t.co/8UWUZn8dLk', 'display_text_range': [0, 259], 'entities': {'hashtags': [], 'urls': [{'url': 'https://t.co/8UWUZn8dLk', 'expanded_url': 'http://bbc.in/2Ghbo65', 'display_url': 'bbc.in/2Ghbo65', 'indices': [236, 259]}], 'user_mentions': [], 'symbols': []}}

{'full_text': '"Will this be a Sars-type outbreak, or like swine flu?"

The expectation is this will be closer to Sars, because the new virus is a relative of Sars. But, we don't know how easily this virus spreads from person to person

https://t.co/8UWUZn8dLk', 'display_text_range': [0, 245], 'entities': {'hashtags': [], 'urls': [{'url': 'https://t.co/8UWUZn8dLk', 'expanded_url': 'http://bbc.in/2Ghbo65', 'display_url': 'bbc.in/2Ghbo65', 'indices': [222, 245]}], 'user_mentions': [], 'symbols': []}}

{'full_text': '“There are three flights from Wuhan to London a week, should we be wearing face masks on public transport?”

No. There are still no cases in the UK and the risk is deemed to be "low". Seasonal flu is still a bigger risk to your health in the UK

